import React, { Component } from 'react';

class Highlights extends Component {
    render() {
        return (
            <grid item direction="row">
                <h1>
                    Home
                </h1>

                <h1>
                    Projects
                </h1>

                <h1>
                    About Me
                </h1>
            </grid>


        )
    }
}

export default Highlights;
